import axios, { AxiosResponse } from "axios";

const getNewCategor = (): Promise<AxiosResponse> => {
  const requestUrl = "https://api.tvmaze.com/search/shows?q=action";
  const response = axios.get(requestUrl);

  return response;
  
};
export default getNewCategor;
